import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 16.1-333 Findings necessary to order that minor is emancipated.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/16.1-333.md","filePath":"vacode/16.1-333.md"}'),i={name:"vacode/16.1-333.md"},n=r('<h1 id="§-16-1-333-findings-necessary-to-order-that-minor-is-emancipated" tabindex="-1">§ 16.1-333 Findings necessary to order that minor is emancipated. <a class="header-anchor" href="#§-16-1-333-findings-necessary-to-order-that-minor-is-emancipated" aria-label="Permalink to &quot;§ 16.1-333 Findings necessary to order that minor is emancipated.&quot;">​</a></h1><p>The court may enter an order declaring the minor emancipated if, after a hearing, it is found that: (i) the minor has entered into a valid marriage, whether or not that marriage has been terminated by dissolution; (ii) the minor is on active duty with any of the armed forces of the United States of America; (iii) the minor willingly lives separate and apart from his parents or guardian, with the consent or acquiescence of the parents or guardian, and that the minor is or is capable of supporting himself and competently managing his own financial affairs; or (iv) the minor desires to enter into a valid marriage and the requirements of § <a href="http://law.lis.virginia.gov/vacode/16.1-333.1/" target="_blank" rel="noreferrer">16.1-333.1</a> are met.</p><p>1986, c. 506; 2016, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0457" target="_blank" rel="noreferrer">457</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0543" target="_blank" rel="noreferrer">543</a>.</p>',3),o=[n];function s(d,c,h,m,l,f){return a(),t("div",null,o)}const g=e(i,[["render",s]]);export{_ as __pageData,g as default};
